import { useDispatch, useSelector } from 'react-redux'
import { listAllHomes } from '../../actions/homeActions'
import { Row, Col } from 'react-bootstrap'


const LandingPage = () =>{

    const dispatch = useDispatch()
    const lHomes = useSelector(state => state.listHomes)
    const { loading, error, homes} = lHomes
    useEffect(() => {
        dispatch(listAllHomes())
    },
    [dispatch])

        return (
            <>
                <h1>LandingPage</h1>
                <Row>
                {homes.map(home => (
                    <Col key={home._id} sm={12} md={12} lg={10} xl={10} >
                        <Home home={home.location} />
                    </Col>
                ))}
                </Row>
            </>
        )

}

export default LandingPage
